window.bookSummaryJSON = "<p>Dawn's light spreads out in a gentle rising crescendo over mossy waterfalls and unfurling honeysuckle vines as the gossamer film of sleep dissolves into wakefulness.&nbsp;&nbsp;&nbsp;</p> <p>Our morning music tracks were created to help you start your day on the right foot but can be enjoyed any time of day. They're both contemplative and energizing and help to create a positive atmosphere whenever you're looking for an energy shift.&nbsp;&nbsp;</p> <p>Sean Cronin is a composer and multi-instrumentalist whose work spans jazz, country, punk, classical, folk, early rock ’n’ roll, experimental, and theatrical music genres. He’s toured internationally, led several bands, and acted and performed with Chelsea Hotel: Songs of Leonard Cohen. Sean has been the recipient of the Grand Prix du Jazz at the Montreal International Jazz Festival, and his score for <i>Kill Me Like You Mean It</i> was nominated for a Drama Desk Award in 2015.&nbsp;&nbsp;</p> <p>This title is part of the Audible Sleep Collection, exclusive audio experiences created to help you fall asleep, stay asleep, and wake up in the right morning mindset. New and free for members.&nbsp;&nbsp;</p> <p>Sean Cronin: piano, bass&nbsp;</p> <p>Clara Kennedy: cello&nbsp;</p> <p>Joe MacDonough: trombone&nbsp;&nbsp;</p> <p>Skye Steele: violin&nbsp;</p> <p>Cat Toren: piano&nbsp;&nbsp;</p> <p>DeShaun Gordon-King: flute</p>"; 
